import React from "react";
import "./footer.css";
import { Link } from "react-router-dom";

const Footer = () => {
  // Function to scroll back to the top
  const scrollToTop = () => {
    window.scrollTo({
      top: 0,
      behavior: "smooth", // Smooth scrolling effect
    });
  };

  return (
    <footer className="footer">
      <div className="container">
        <div className="footer-container">
          {/* Company Info */}
          <div className="footer-section company-info">
            <img
              src="/images/products/Brand-icon.png"
              alt="DD Plastic Logo"
              className="footer-logo"
            />
            <h3 className="footer-title">DD Plastic</h3>
            <p className="footer-description">
              Providing premier wire and cable solutions for over 25 years.
              Committed to quality, efficiency, and customer satisfaction.
            </p>
          </div>

          {/* Useful Links */}
          <div className="footer-section useful-links">
            <h4 className="footer-subtitle">Useful Links</h4>
            <ul className="footer-links">
              <li><Link to="/home">Home</Link></li>
              <li><Link to="/about">About</Link></li>
              <li><Link to="/products">Products</Link></li>
              <li><Link to="/contact">Contact</Link></li>
            </ul>
          </div>

          {/* Products */}
          <div className="footer-section products">
            <h4 className="footer-subtitle">Products</h4>
            <ul className="footer-products">
              <li><Link to="/products/old-stamp">Old Stamp</Link></li>
              <li><Link to="/products/new-stamp">New Stamp</Link></li>
              <li><Link to="/products/ink-stamp">Ink Stamp</Link></li>
              <li><Link to="/products/stamp-pads">Stamp Pads</Link></li>
            </ul>
          </div>

          {/* Contact Info & Social Media */}
          <div className="footer-section contact-info">
            <h4 className="footer-subtitle">Contact Info</h4>
            <p><i className="bi bi-envelope-at-fill"></i> <a href="mailto:ddPalastic98@gmail.com">ddPalastic98@gmail.com</a></p>
            <p><i className="bi bi-geo-alt-fill"></i> I-245, Sector - 5, DSIIDC, Bawana Industrial Area, Delhi, India. Pin Code - 110039</p>
            <p><i className="bi bi-telephone-fill"></i> Contact No: 7982167578</p>
          </div>
        </div>
        <div className="footer-back-to-top">
          <button onClick={scrollToTop} className="back-to-top-button" aria-label="Back to top">↑</button>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
